    	        </div>

    	        <div>
	    	        <label for="fname">Last Name:</label><br/>
	    	        <input type="text" id="fname" value="Kim"></input><br/><br/>
    	        </div>

    	        <div>
	    	        <p id = "para"> Favorite Color:</p>
                    <input type="radio" id="fname" value="hello"></input><label for="fname"> Red </label><br/><br/>
